import React, { Component } from 'react';
import './App.css';
import Login from './login/login';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: "Priyankabauskar",
      password: "abc@123"
    };
    this.updatedUsername = this.updatedUsername.bind(this);
    this.updatedpassword = this.updatedpassword.bind(this);
  }
  updatedUsername(e) {
    this.setState({ _username: e.target.value });
  }
  updatedpassword(e) {
    this.setState({ _password: e.target.value });
  }
  validation = () => {
    console.log( this.state._username);
    if (
      this.state.username === this.state._username &&
      this.state.password === this.state._password
    ) {
      alert("success");
    } else {
      alert("fail");
    }
  };

  render() {
    return (
      <div className="App">
       <Login 
       click={this.validation}/>
      </div>
    );
  }
}
export default App;
